import React from "react";
import { Link } from 'react-router-dom';

const ModeSelect = ({ handleWineSelect }) => {
  return (
    <div className="mode-select">
          <Link to="/menufood">
              <div className="mode-top"><p>I have a recipe.</p><p>Help me find a wine!</p></div>
      </Link>
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#50183d" fill-opacity="1" d="M0,224L1440,96L1440,320L0,320Z"></path></svg>
          <Link to="/menuwine">
              <div className="mode-bottom"><p>I have a wine.</p><p>Help me find a recipe!</p></div>
          </Link>
    </div>
  );
};

export default ModeSelect;
